import React from "react";
import "./MainPage.css"

import NavBar from "../components/NavBar";

export default function MainPage() {

    return(
        <div className="mainpage-container">
            <NavBar activePage={"home"}/>
            <img className="main-photo" src="https://www.theinsideword.ac.nz/files/2017/10/IMG_1188-19x5akd-1080x675.jpg" alt="Home page photo"/>
        </div>
    )
}
